see <a href="http://dla.library.upenn.edu/dla/franklin/record.html?&amp;id=FRANKLIN_5402499&amp" rel="nofollow">dla.library.upenn.edu/dla/franklin/record.html?&amp;id=FR...</a>;

I think all of these inscriptions were written by the same guy: Geronimo Gaurano or Geronimus Gauranis (Gauranus). I'm not quite sure his first name is really Geronimo (but I couldn't find an alternative) and his last name is probably Gaurano (Gauranis or Gauranis in Latin). 
He seems to repeat the inscription (his ownership mark of the book) several times in Latin, in Italian and in a weird combination of the two languages. There are two other similar inscriptions on the opposite page of this one. Unfortunately, I couldn't find anyone with this name.

 &quot;1596 [?] [..] il cl[arissi]mo et ill[ustrissi]mo sig[no]r Bartolameo [?] mano [?] ... della Ceffallonia gen[..]lomo onorazo et molto a gracyas da tutti&quot;
&quot;ego ger[oni]mus? gauranis [?] e mj hunc librum propter [?] amicos meos&quot;
&quot;Jo. Ger[oni]mo? Gaura (Gaumi?) affirmo quanto di sopra&quot;
&quot;questo libro sia di mi ...&quot;

&quot;Spectat ad Biblio[thecam]  S. Francisci P.F. Reformat[orum]? Cenet[ae]&quot;
Ms. ownership inscription of the library of Convento di San Francesco di Ceneda of the Reformed Franciscans. Also appears in <a href="http://webcache.googleusercontent.com/search?q=cache:b2_qo5HYMhAJ:www.ibisweb.it/cgi-bin/wwwi32.exe/[in=%5Cibisweb%5Cwwwroot%5Copac2%5Cmod%5Ccerca.in]/?ambito%5Et3030=&amp;espressione%5Et3008=0441180&amp;lingua%5Et3009=&amp;materiale%5Et3010=&amp;ricerca%5Et3013=libera&amp;count=20&amp;formato=esteso1&amp;archivio=biblo+&amp;cd=3&amp;hl=en&amp;ct=clnk&amp;gl=us" rel="nofollow">this book.</a>
Second inscription  &quot;Donum D.  Bartholom[a]ei Zorzi de Ampitio&quot; probably belongs to Bartolomeo Zorzi d'Ampezzo (no dates). Cf. <a href="http://webcache.googleusercontent.com/search?q=cache:42R0h49DJrkJ:www.ibisweb.it/cgi-bin/wwwi32.exe/[in=\ibisweb\wwwroot\opac\mod\cerca.in]/?format^t3070=&amp;ambito^t3007=&amp;espressione^t3008=0737345&amp;lingua^t3009=&amp;materiale^t3010=&amp;ricerca^t3013=libera&amp;count=20&amp;formato=ISBD1&amp;archivio=biblo+&amp;cd=4&amp;hl=en&amp;ct=clnk&amp;gl=us" rel="nofollow">this record</a>.

Ownership inscription: 
&quot;Courtney Kenny, his book&quot;

Still need dates.

&quot;D. Andreae Vesalii ex[?]ilantis obituis ...
Huibertus [?] ...ad D. Casparum ..&quot;
Fama est, Vesalium essu mortuum ...&quot;
I think the inncription refers to Andreas Vesalius ( 1514-1564), a Flemish anatomist, physician, and author of one of the most influential books on human anatomy, De humani corporis fabrica (On the Structure of the Human Body). Vesalius is often referred to as the founder of modern human anatomy. The book is about drugs and materia medica of India, so it kind of makes sense we have the name of a doctor.
Also I can't read the whole inscription, but I think it might be an obituary, because the word &quot;obituis[?] probably comes from obituarius, (report of death) or form obitus (death). The inscription is dated January 1565 at the end, and Vesalius died in October 1564, so it would make sense to have an obituary in 1565. The guy who wrote is probably the name in the second line of the inscription, but I can't read it well.
Established form: <a href="http://viaf.org/processed/LC|n  81035178" rel="nofollow">Vesalius, Andreas, 1514-1564</a>

Stamp of the Wissenschaftliches Institut der Elsass-Lothringer im Reich, Frankfurt am Main, Germany.

According to <a href="http://www.ub.uni-frankfurt.de/archive/institut.html" rel="nofollow">this page</a> of the library website of the Goethe Universität Frankfurt am Main, &quot;The Wissenschaftliches Institut der Elsass-Lothringer im Reich was founded at the Universität Frankfurt am Main in 1921 with the goal of serving 'the common economic and cultural interests of Alsace-Lorraine in the kingdom to the exclusion of political efforts.'  In the year 1963 the Erwin von Steinbach-Stiftung and the University library concluded a deposit agreement for the collection of the Wissenschaftliches Institut der Elsass-Lothringer im Reich by which the Institut's library with its more than 25000 volumes and the remainder of its archives were given on permanent loan to the Stadt- und Universitätsbibliothek Frankfurt am Main.&quot;

